import React, { useState } from "react";
import { Box } from "rebass";
import { Link } from "react-router-dom";
import { Menu, Icon } from 'antd';

const Header = ({ ...props }) => {
	const [current, updateCurrent] = useState('1')
	const handleClick = (key) => {
		updateCurrent(key)
	}
  return (
    <Box>
      <Box width="100%" style={{ background: "gray", height: "100px" }}>
        <Menu
          onClick={handleClick}
          selectedKeys={[current]}
          mode="horizontal"
        >
          <Menu.Item key="1" icon={<Icon type="team" />}>
            Users
          </Menu.Item>
          <Menu.Item key="2" disabled icon={<Icon type="tags" />}>
            Tags
          </Menu.Item>
        </Menu>
      </Box>
      {React.createElement(props.child, { ...props })}
    </Box>
  );
};

export default Header;
